import React from 'react';
import {StyleSheet, Text} from 'react-native';
import {Avatar, Dropdown, Icon, Nav, Navbar} from 'rsuite';
;

const Mystyle:any={
  logoStyles:{
    marginLeft:"25px",
    marginTop:"5px",
    marginBottom:"18px"
  },
  textPosition:{
    paddingTop:'13px',
    paddingLeft:"3px"
  },
  textStyle:{
    fontSize:20,
    fontWeight:"bold",
    color:"#5987AF"
  }
}

const HeaderV=()=>{
  return(
    <Navbar>
    <Navbar.Header>
    </Navbar.Header>
    <Navbar.Body>
      <Nav pullRight>
  <Nav.Item > <Avatar
      circle
      size="sm"
      src="https://avatars2.githubusercontent.com/u/12592949?s=460&v=4"
    /></Nav.Item>
      </Nav>
      <Nav pullRight>
  <Nav.Item icon={<Icon icon="home" />}>Home</Nav.Item>
        <Nav.Item>News</Nav.Item>
        <Nav.Item>Products</Nav.Item>
        <Dropdown title="About">
          <Dropdown.Item>Company</Dropdown.Item>
          <Dropdown.Item>Team</Dropdown.Item>
          <Dropdown.Item>Contact</Dropdown.Item>
        </Dropdown>
      </Nav>
      <Nav>
        <img src ="https://i.ibb.co/H4r74P1/trag-icon.png" width="40" height="40" style={StyleSheet.flatten([Mystyle.logoStyles])}/>
        </Nav>
        <Nav  style={StyleSheet.flatten([Mystyle.textPosition])}>
        <Text  style={StyleSheet.flatten([Mystyle.textStyle])}>
          Trag
        </Text>
      </Nav>
    </Navbar.Body>
  </Navbar>
  )
}

export default HeaderV;
